function Dashboard () {

  return(
    <div>
      {/* <img src="" alt="" srcset="" /> */}



      <h1>About Me</h1>
      <p>Hi, I am Madhavi, and I'm passionate about building the websites. I have started volunteering as a Digital Hub tutor in the library helping many people to navigate computers and mobile phones. That led me into having interest in User Experience Design.  </p>
      <p>I was working in civil engineering field and when I come to australia I've worked as a customer service officer and helping people as a volunteer. </p>
      <p>Lately, I've discovered my passion for the world of web development and the beauty behind building useful websites like the one you will find in this portfolio. I'm now looking for a junior dev position to finally kick start my career and learn among professionals.</p>


      <h3>Skills</h3>



    </div>
  )


}

export default Dashboard;
